{"version":"NotebookV1","origId":2006034234003968,"name":"VariantSpark_HipsterIndex_Spark2.2","language":"scala","commands":[{"version":"CommandV1","origId":2006034234003969,"guid":"b83e77ce-de05-4e81-9837-41ad32756e66","subtype":"command","commandType":"auto","position":2.0,"command":"%md\n## About the [**VariantSpark**](http://bioinformatics.csiro.au/variantspark) Demo\n* A custom machine learning library for real-time genomic data analysis \n  * Works with thousands of samples and **millions** of variants \n  * Implements a custom **random forest** algorithm built on Apache Spark\n  * Authored in Scala by the team at [CSIRO Bioinformatics](http://bioinformatics.csiro.au/) Australia\n  \n* Finds the most *important* variants attributing to a phenotype of interest \n  * Uses a synthetic phenotype called *HipsterIndex* \n  * Includes a dataset with a subset of the samples and variants \n  * Uses VCF format - from the 1000 Genomes Project ","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1543952605458,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"756319@red30tech.com","latestUserId":2682656011365665,"commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"datasetPreviewNameToCmdIdMap":{},"nuid":"e1281527-2858-44f2-b4f7-f68dbb07700e"},{"version":"CommandV1","origId":2006034234003970,"guid":"1ac9b813-a903-4036-8df9-67a21d03c939","subtype":"command","commandType":"auto","position":3.0,"command":"%md\n## About the Hipster Index\nThe synthetic HipsterIndex was created using the following genotypes and formular:\n\n| ID |SNP ID     | chromosome | position | phenotype | reference |\n|---:|----------:|----:|-------:|-----:|----------:|------:|\n| B6 |[rs2218065](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=2218065) | chr2 | 223034082 | monobrow | [Adhikari K, et al. (2016) Nat Commun.](https://www.ncbi.nlm.nih.gov/pubmed/?term=26926045) |\n| R1 |[rs1363387](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=1363387) | chr5 | 126626044 | Retina horizontal cells (checks) | [Kay, JN et al. (2012) Nature](https://www.ncbi.nlm.nih.gov/pubmed/?term=22407321)\n| B2 |[rs4864809](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=4864809) | chr4 |  54511913 | beard | [Adhikari K, et al. (2016) Nat Commun.](https://www.ncbi.nlm.nih.gov/pubmed/?term=26926045)\n| C2 |[rs4410790](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=4410790)  |chr7 |17284577| coffee consumption        | [Cornelis MC et al. (2011) PLoS Genet.](https://www.ncbi.nlm.nih.gov/pubmed/?term=21490707) |\n\n`HipsterIndex = ((2 + GT[B6]) * (1.5 + GT[R1])) + ((0.5 + GT[C2]) * (1 + GT[B2]))`\n\n  GT stands for the genotype at this location with *homozygote* reference encoded as 0, *heterozygote* as 1 and *homozygote alternative* as 2. We then label individuals with a HipsterIndex score above 10 as hipsters, and the rest non-hipsters. By doing so, we created a binary annotation for the individuals in the 1000 Genome Project.\n\nIn this notebook, we demonstrate the usage of VariantSpark to **reverse-engineer** the association of the selected SNPs to the phenotype of insterest (i.e. being a hipster).","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1543952605674,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"756319@red30tech.com","latestUserId":2682656011365665,"commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"datasetPreviewNameToCmdIdMap":{},"nuid":"d22689fc-2ebf-41db-8b63-047127f6c853"},{"version":"CommandV1","origId":2006034234003971,"guid":"b99494d1-0736-486a-8062-5f0ff1303d23","subtype":"command","commandType":"auto","position":4.0,"command":"%md\n###0. SETUP -- Databricks Spark cluster and VariantSpark:  \n\n1. **Import** the variant-spark libary into your Databricks instance by...  \n  - Navigate to `Workspace > Users > Username` and select `Create > Library`    \n  - Click on `maven coordinates` in the source list in the 'Create Library' page\n  - Enter `au.csiro.aehrc.variant-spark:variant-spark_2.11:0.2.0-a1` in the coordinate text box\n  - Click `advanced` and enter `https://oss.sonatype.org/content/repositories/snapshots` in repository text box\n  - Click the `create library` button\n  - Verify that the option `automatically attach to all clusters` is checked in the libraries page\n2. **Create** a cluster by...  \n  - Click the `Clusters` icon on the left sidebar and then `Create Cluster.` \n  - Enter any text, i.e `demo` into the cluster name text box\n  - Select the `Apache Spark Version` value `Spark 2.2.0 (scala 2.11)`  \n  - Click the `create cluster` button and wait for your cluster to be provisioned\n3. **Attach** this notebook to your cluster by...   \n  - Click on your cluster name in menu `Detached` at the top left of this workbook to attach it to this workbook ","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1543952605952,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":nu