o","position":11.0,"command":"%md\n###4. CONFIGURE ANALYSIS using VariantSpark   \n\n1. Use Scala to create an instance of the ImportanceAnalysis object\n2. Pass the featureSoure (feature file), labelSource (label file), and number of trees to the instance","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1543952607589,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"756319@red30tech.com","latestUserId":2682656011365665,"commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"datasetPreviewNameToCmdIdMap":{},"nuid":"6e7f01c2-facb-4e16-b686-97e4390c8e71"},{"version":"CommandV1","origId":2006034234003979,"guid":"b6f37a1a-4b3f-4c7f-b30d-1830998191ba","subtype":"command","commandType":"auto","position":12.0,"command":"val importanceAnalysis = ImportanceAnalysis(featureSource, labelSource, nTrees = 1000)","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">importanceAnalysis: au.csiro.variantspark.api.ImportanceAnalysis = au.csiro.variantspark.api.ImportanceAnalysis@15a5cc91\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1543952630235,"submitTime":1543952607809,"finishTime":1543952849829,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars