t's association to the phenotype of interest. The Importance score is calculated based on the [Gini Impurity](https://en.wikipedia.org/wiki/Decision_tree_learning#Gini_impurity) scores of the decision trees in the random forest built by VariantSpark. In the decision tree building process, at each tree node, VariantSpark uses variants from the VCF dataset to split the samples and calculate the Gini Impurity scores before and after the split. At a given node _N_, the decrease in the Gini Impurity score by splitting using a feature _p_ is defined as \n$$\n\\Delta I = I(N) - (I(L) + I(R)),\n$$ \nwhere _I(N)_ is the Gini Impurity at node _N_, and _I(L)_ and _I(R)_ are the Gini Impurity scores of the left and right child node, respectively. Then, the Importance score of variant _p_ is defined as the mean of the decrease in Gini Impurity score by splitting using the variant _p_ across all nodes and trees in the random forest. A variant with __higher Importance score implies it is more strongly associated with the phenotype of interest__.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1543952608474,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"756319@red30tech.com","latestUserId":2682656011365665,"commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"datasetPreviewNameToCmdIdMap":{},"nuid":"c5b6d5e2-8feb-4f53-9c83-b52aae942111"},{"version":"CommandV1","origId":2006034234003983,"guid":"a87238ac-ae19-4f1a-9d75-26677feb0f61","subtype":"command","commandType":"auto","position":16.0,"command":"%md\n###6a. VISUALIZE ANALYSIS us